define('text!views/login.html',[],function () { return '<section style="margin-top: 35px; margin-right: 101px;">\r\n<form class="form-horizontal" role="form">\r\n        <div class="form-group">\r\n            <label class="col-lg-2 control-label" for="inputUsername">Usuario</label>\r\n            <div class="col-lg-10">\r\n                <input type="text" class="form-control" id="inputUsername" data-bind="value: username"  placeholder="Introduce el nombre del usuario"/>\r\n            </div>\r\n        </div>\r\n        <div class="form-group">\r\n            <label class="col-lg-2 control-label" for="inputPassword">Contrasea</label>\r\n            <div class="col-lg-10">\r\n                <input type="password" data-bind="value: password" class="form-control" id="inputPassword" placeholder="Password"/>\r\n            </div>\r\n        </div>\r\n        \r\n        <div class="form-group">\r\n            <div class="col-lg-offset-2 col-lg-10">\r\n                <div class="checkbox">\r\n                    <label>\r\n                        <input type="checkbox" data-bind="checked: rememberMe">\r\n                        Recordarme\r\n                    </label>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        \r\n        <div class="form-group">\r\n            <div class="col-lg-offset-2 col-lg-10">\r\n                <button type="submit" class="btn btn-default" data-bind="\'click-loading\': login">Entrar</button>\r\n                <button type="submit" class="btn btn-default" data-bind="click: signUp">Crear usuario</button>\r\n            </div>\r\n        </div>        \r\n    </form>\r\n</section>';});


